import './Contact.css'

const Contact = () => {
  return (
    <div>
      <p>You may contact us directly through phone call or text message, preferably during office hours however we do handle emergency situations 24 hours a day as well.</p>
      <p>Dont forget about our discounts we offer as shown below!</p>
    </div>
  );
};


export default Contact;
